def get_parcel_from_uldk(parcel_id: str) -> str:
    """This function looks up the parcel using ULDK (Polish Cadastre Identification Service)."""
    print(f"Sprawdzam dziak {parcel_id} w ULDK...")
    with request.urlopen(f"https://uldk.gugik.gov.pl/?request=GetParcelById&id={parcel_id}&result=geom_wkt") as p:
        parcel_wkt: str = p.read().decode("utf-8")
    return parcel_wkt

if __name__ == "__main__":
    while True:
        is_dg_input: str = input("Czy dziaka jest w Dbrowie Grniczej? [t/n] ")
        match is_dg_input.lower():
            case "t":
                break
            case "n":
                sys.exit("My tu nie rewitalizujemy.")
            case _:
                print("Odpowiedz 't' lub 'n'.")

    districts: list[tuple[str, str]] = [
        ("0001", "Bdw"),
        ("0002", "Bugaj"),
        ("0004", "Kuniczka"),
        ("0005", "azy"),
        ("0006", "ka"),
        ("0007", "osie"),
        ("0008", "Marianki"),
        ("0009", "Okradzionw"),
        ("0010", "Ratanice"),
        ("0011", "Sikorka"),
        ("0012", "Strzemieszyce Mae"),
        ("0013", "Strzemieszyce Wielkie"),
        ("0014", "Trzebiesawice"),
        ("0015", "Trzebyczka"),
        ("0016", "Tucznawa"),
        ("0017", "Ujejsce"),
        ("0018", "Zbkowice"),
        ("0019", "Dbrowa Grnicza I"),
        ("0020", "Dbrowa Grnicza II"),
        ("0021", "Dbrowa Grnicza III"),
        ]

    # MAYBE: consider using a dict with the canonical district numbers
    while True:
        print("W ktrym obrbie?")
        for n, district in enumerate(districts):
            print(f"{n + 1} - {district[1]}")
        district_input: str = input("Wybierz numer [1-20]: ")
        try:
            district_choice: int = int(district_input)
            if district_choice in range(1, len(districts) + 1):
                district_number: str = districts[district_choice - 1][0]
                break
            else:
                district_try_again = input("Wybrano numer spoza listy. Chcesz sprbowa ponownie? [t/n] ")
                match district_try_again.lower():
                    case "t":
                        print(f"Podaj nr z lewej strony wybranego obrbu od 1 do {len(districts) +1}.")
                        continue
                    case _:
                        sys.exit("Bez numeru obrbu nie sprawdz dziaki w ULDK")
        except ValueError:
            district_try_again_on_e: str = input("Znasz obrb, prawda? [t/n] ")
            match district_try_again_on_e.lower():
                case "t":
                    print("Podaj nr z lewej strony wybranego obrbu.")
                    continue
                case _:
                    sys.exit("Nie wiesz, ktry obrb? Nie pomog...")

    # Regex: one or more digits maybe followed by a single slash and one or more digits
    plot_pattern = re.compile(r"^\d+(/{1}\d+)?$")
    while True:
        plot_number_input: str = input("Wpisz numer dziaki: ")
        if bool(re.match(plot_pattern, plot_number_input)):
            plot_number: str = plot_number_input
            break
        else:
            print("Niewaciwy format numeru dziaki.")
            plot_try_again: str = input("Chcesz sprbowa jeszcze raz? [t/n] ")
            match plot_try_again.lower():
                case "t":
                    continue
                case _:
                    sys.exit("Wrc z numerem dziaki w prawidowym formacie.")

    full_parcel_id: str = f"246501_1.{district_number}.{plot_number}"
    parcel_resp: list[str] = get_parcel_from_uldk(full_parcel_id).split(sep=";")
    revit_area_geom = [from_wkt(REV_AREA_WKT)]
    try:
        parcel_geom = [from_wkt(parcel_resp[1])]
    except IndexError:
        sys.exit("Podany numer dziaki jest nieprawidowy, albo ULDK nie dziaa... albo jedno i drugie.")

    revit_area_gds = gpd.GeoSeries(revit_area_geom, crs=CRS)
    parcel_gds = gpd.GeoSeries(parcel_geom, crs=CRS)

    intersection_gds = parcel_gds.intersection(revit_area_gds)

    if intersection_gds.is_empty.loc[0]:
        print("Tu nie rewitalizujemy.")
    else:
        print("Halo! My tu rewitalizujemy.")
